import React from 'react';
import Layout from '../Templates/Layout';

import Button from 'react-bootstrap/Button'

const HomePage = () => {
  return (
    <Layout>
      <div className="container-fluid text-center center-pad">
        <h1 className="display-4">PeerPrep</h1>
        <h3 className="pt-3">Acing tech interviews 2 at a time</h3>
        <Button variant="primary" size="lg" className="mt-5 pp-button">Sign Up</Button>{' '}
      </div>

      <div className="container-fluid text-center bg-light-blue center-pad">
        <h1 className="display-4">PeerPrep</h1>
        <h3 className="pt-3">Acing tech interviews 2 at a time</h3>
        <Button variant="primary" size="lg" className="mt-5 pp-button">Sign Up</Button>{' '}
      </div>
    </Layout>
  );
};

export default HomePage;
